CREATE OR REPLACE FUNCTION update_jumlah_pelamar()
RETURNS trigger AS
$$
DECLARE
BEGIN
IF (TG_OP = 'INSERT') THEN
UPDATE PENERIMAAN_PRODI
SET jumlah_pelamar = jumlah_pelamar+1
WHERE kode_prodi = NEW.kode_prodi AND (nomor_periode, tahun_periode) IN (SELECT nomor_periode, tahun_periode FROM PENDAFTARAN WHERE id = NEW.id_pendaftaran);
RETURN NEW;
ELSEIF (TG_OP = 'DELETE') THEN
UPDATE PENERIMAAN_PRODI
SET jumlah_pelamar = jumlah_pelamar-1
WHERE kode_prodi = OLD.kode_prodi AND (nomor_periode, tahun_periode) IN (SELECT nomor_periode, tahun_periode FROM PENDAFTARAN WHERE id = OLD.id_pendaftaran);
RETURN OLD;
ELSE
UPDATE PENERIMAAN_PRODI
SET jumlah_pelamar = jumlah_pelamar-1
WHERE kode_prodi = OLD.kode_prodi AND (nomor_periode, tahun_periode) IN (SELECT nomor_periode, tahun_periode FROM PENDAFTARAN WHERE id = OLD.id_pendaftaran);
UPDATE PENERIMAAN_PRODI
SET jumlah_pelamar = jumlah_pelamar+1
WHERE kode_prodi = NEW.kode_prodi AND (nomor_periode, tahun_periode) IN (SELECT nomor_periode, tahun_periode FROM PENDAFTARAN WHERE id = NEW.id_pendaftaran);
RETURN NEW;
END IF;
END;
$$
LANGUAGE plpgsql;

CREATE TRIGGER trigger_updateJumlahPelamar
AFTER INSERT OR UPDATE OR DELETE
ON PENDAFTARAN_PRODI FOR EACH ROW
EXECUTE PROCEDURE update_jumlah_pelamar();

=============================3b============================
CREATE OR REPLACE FUNCTION update_jumlah_diterima()
RETURNS trigger AS
$$
DECLARE
BEGIN
IF (NEW.status_lulus = 'TRUE') THEN
UPDATE PENERIMAAN_PRODI
SET jumlah_diterima = jumlah_diterima+1
WHERE NEW.status_lulus = 'TRUE' AND kode_prodi = NEW.kode_prodi AND NEW.status_lulus = 'TRUE' AND (nomor_periode, tahun_periode) IN (SELECT nomor_periode, tahun_periode FROM PENDAFTARAN WHERE id = NEW.id_pendaftaran);
RETURN NEW;
ELSE
UPDATE PENERIMAAN_PRODI
SET jumlah_diterima = jumlah_diterima+0
WHERE kode_prodi = NEW.kode_prodi AND NEW.status_lulus = 'FALSE' AND NEW.status_lulus = 'FALSE' AND (nomor_periode, tahun_periode) IN (SELECT nomor_periode, tahun_periode FROM PENDAFTARAN WHERE id = NEW.id_pendaftaran);
RETURN NEW;
END IF;
END;
$$
LANGUAGE plpgsql;

CREATE TRIGGER trigger_updateJumlahDiterima
AFTER UPDATE
ON PENDAFTARAN_PRODI FOR EACH ROW
EXECUTE PROCEDURE update_jumlah_diterima();